import React from "react";
import './styles/shedule.css';
import Header from "../components/Header";
import Footer from "../components/Footer";
import Input from "../components/Input";

const Shedule = () => {
    return(
        <div className='Shedule bg-white'>
            <Header/>
            <div className='Shedule-first-block'>
                <div className='Shedule-first-block-img'/>
                <div className='Shedule-first-block-blur bg-darkBlue70'>
                    <h2 className='Display-1 tx-white'>Розклад</h2>
                </div>
            </div>
            <div className='Shedule-second-block'>
                <div className='Shedule-second-block-bg bg-lightF'>
                    <Input width={280} placeholder='Введіть кабінет' type='number'/>
                </div>
            </div>
            <Footer/>
        </div>
    );
};
export default Shedule;
